					where (  (localidad_id=',p_loc,') AND e.id IN (15 , 67, 28, 74, 40, 13, 81, 22, 47, 29, 80, 89) and pe.gonada_id!=5 and pe.gonada_id!=6 and sexo_id=2)
			group by e.descripcion,camp ASC)as asd 
				GROUP BY esp,des
